import React from 'react';
import './Homestyles.css';
import contacts from '../images/contact-lenses.png';
import sunglasses from '../images/sunglasses.png';
import spectacles from '../images/spectacles.png';
import { Link } from 'react-router-dom';

function Home(){
	return (
		<div>
			<div className="spacer">
			</div>
			<div className="outerdiv">
				<div className="halfholder">
					<div className="imageholder">
						<Link to="/product/contact_lens"><img src={contacts} alt='contact lens' className="gallery"/></Link>
					</div>
				</div>
				<div className="halfholder">
					<div className="imageholder">
						<Link to="/product/sunglasses"><img src={sunglasses} alt='sunglasses' className="gallery"/></Link>
					</div>
				</div>
				<div className="halfholder">
					<div className="imageholder">
						<Link to="/product/spectacles"><img src={spectacles} alt='spectacles' className="gallery"/></Link>
					</div>
				</div>
			</div>
		</div>
	);
}

export default Home;
